import React from 'react';
import { Button } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import premiumBanner from '../images/premium-banner.svg';

const useStyles = makeStyles((theme) => ({
    layout: {
        width: '100vw',
        height: 'auto'
    },
    button: {
        position: 'absolute',
        left: 100,
        top: 300
    },
}));

const PremiumBanner = (props) => {
    const classes = useStyles();

    return (
        <div>
            <img src={premiumBanner} alt="banner" className={classes.layout} />
            <Button className={classes.button} variant="contained" color="primary" >Get Started</Button>
        </div>
    );
}

export default PremiumBanner;
